import '../css/Start.css';

function Start() {
  return (
    <div className="all">
        <div className="menuBtn">
          <button className="Bt 1">여행지</button>
          <button className="Bt 2">음식점</button>
          <button className="Bt3">숙박</button>
          <button className="Bt">기타</button>
          
          
        </div> 
    </div>
  );
}

export default Start;
